(12, 'knowledge management', '<p>Manajemen pengetahuan merupakan pengelolaan pengetahuan perusahaan dalam menciptakan nilai bisnis <em>(business value)</em> dan menghasilkan keunggulan kompetitif yang berkesinambungan <em>(sustainable competitive advantage)</em> dengan mengoptimalkan proses penciptaan, komunikasi dan implementasi semua pengetahuan yang dibutuhkan dalam rangka pencapaian tujuan bisnis (Tiwana, 2001).</p>\r\n<p>&ldquo;Manajemen pengetahuan merupakan suatu pendekatan yang sistematik untuk mengelola aset intelektual dan informasi lain sehingga memberikan keunggulan bersaing bagi perusahaan&rdquo; (Batgerson, 2003).</p>\r\n<p>Manajemen pengetahuan dapat didefinisikan sebagai disiplin ilmu yang sistematis dan serangkaian pendekatan untuk mendapatkan informasi dan pengetahuan untuk mengembangkan dan memberi nilai pada organisasi. Manajemen pengetahuan melibatkan orang, informasi, alur kerja, penggunaan <em>tools, best practices</em>, dan <em>community of practice</em> (Rao, 2004).</p>\r\n<p>Manajemen pengetahuan adalah pelaksanaan penciptaan, penangkapan, pentransferan dan pengaksesan pengetahuan dan informasi yang tepat ketika dibutuhkan untuk membuat keputusan yang lebih baik, bertindak dengan tepat, serta memberikan hasil dalam rangka mendukung strategis bisnis. Manajemen pengetahuan juga didefinisikan sebagai sistem yang memungkinkan perusahaan menyerap pengetahuan, pengalaman, dan kreativitas para stafnya untuk perbaikan kinerja perusahaan. Manajemen pengetahuan merupakan suatu proses yang menyediakan cara sehingga perusahaan dapat mengenali di mana aset intelektual kunci berada, menangkap ukuran aset intelektual yang relevan untuk dikembangkan (Sangkala, 2007).</p>\r\n<p>Dapat disimpulkan bahwa manajemen pengetahuan adalah pendekatan untuk pengelolaan aset pengetahuan yang dapat mendukung pengambilan keputusan, mengembangkan dan memberi nilai pada organisasi serta mendukung strategi bisnis&nbsp; organisasi.</p>', '2015-06-09', '18:25:27', 0, '');

